                        *********SOMBOR Presents********** 

                                     (May 2011)       


                       **********Angry Birds v1.5.1***********

                                   (for Windows)

Game Description:

The Angry Birds have been captured caged and taken to Rio There they meet new friends and work together to make their escape from a desolate grey warehouse to the lush green jungle. Help the Angry Birds escape and beat their captors by bombarding the evil marmosets and smashing all obstacles in Editor Comment

Protect wildlife or play Angry Birds!

System Requirements:

 - Operating System: Windows 7 (SP1), Vista (SP1, SP2) and XP (SP1, SP2, SP3) (x64 also works)
 - Processor: 2 GHz
 - Memory: 512 MB
 - Video: 3D-graphics card compatible with DirectX 9.0c, 128 MB
 - Free space on hard disk: 45,2 MB

